message:
Em frente ao CML no Centro do RJ tem:
- Rancho farto;
- Pratos e talheres descartáveis;
- Banheiro químico;
- Iluminação e tomada.

Quer levar sua água, seu café, sua cadeira? Perfeito!

Leve também agasalho e capa de chuva.
Não há motivo para não participar, até porque estamos encostados na saída do Trem e do Metrô.
Vamos rodiziar com nossos irmãos!
@Womentiras
